const Dashboard = () => {
  return (
    <>
      <div className="container-fluid bg-secondary p-5 text-center">
        <h1 className="text-white">Dashboard</h1>
      </div>
      <div className="container">
        <p>Show all bookings and a button to browse hotels.</p>
      </div>
    </>
  );
};

export default Dashboard;
